import React from 'react';

class Order extends React.Component {
  name = this.props.index
  qty = this.props.details

  render() {
    // console.log(this.props.details)

    return (
      <li>
        <div className="order">
          <p>{name}</p>
          <p>{qty}</p>
        </div>
      </li>
    );
  }
};

export default Order;
